{"version":3,"sources":["webpack://metronic/../demo1/src/js/pages/crud/forms/widgets/bootstrap-touchspin.js"],"names":[],"mappings":";;;;;;AAAa;AACb;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;AACT;;AAEA;AACA;AACA;AACA;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;;AAET;AACA;AACA;AACA;AACA;AACA;AACA,SAAS;AACT;;AAEA;AACA;AACA;AACA;AACA;AACA;AACA;AACA,CAAC;;AAED;AACA;AACA,CAAC","file":"js/pages/crud/forms/widgets/bootstrap-touchspin.js","sourcesContent":["\"use strict\";\r\n// Class definition\r\nvar KTKBootstrapTouchspin = function() {\r\n\r\n    // Private functions\r\n    var demos = function() {\r\n        // minimum setup\r\n        $('#kt_touchspin_1, #kt_touchspin_2_1').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n\r\n            min: 0,\r\n            max: 100,\r\n            step: 0.1,\r\n            decimals: 2,\r\n            boostat: 5,\r\n            maxboostedstep: 10,\r\n        });\r\n\r\n        // with prefix\r\n        $('#kt_touchspin_2, #kt_touchspin_2_2').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n\r\n            min: -1000000000,\r\n            max: 1000000000,\r\n            stepinterval: 50,\r\n            maxboostedstep: 10000000,\r\n            prefix: '$'\r\n        });\r\n\r\n        // vertical button alignment:\r\n        $('#kt_touchspin_3, #kt_touchspin_2_3').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n\r\n            min: -1000000000,\r\n            max: 1000000000,\r\n            stepinterval: 50,\r\n            maxboostedstep: 10000000,\r\n            postfix: '$'\r\n        });\r\n\r\n        // vertical buttons with custom icons:\r\n        $('#kt_touchspin_4, #kt_touchspin_2_4').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n            verticalbuttons: true,\r\n            verticalup: '<i class=\"ki ki-plus\"></i>',\r\n            verticaldown: '<i class=\"ki ki-minus\"></i>'\r\n        });\r\n\r\n        // vertical buttons with custom icons:\r\n        $('#kt_touchspin_5, #kt_touchspin_2_5').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n            verticalbuttons: true,\r\n            verticalup: '<i class=\"ki ki-arrow-up\"></i>',\r\n            verticaldown: '<i class=\"ki ki-arrow-down\"></i>'\r\n        });\r\n    }\r\n\r\n    var validationStateDemos = function() {\r\n        // validation state demos\r\n        $('#kt_touchspin_1_validate').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n\r\n            min: -1000000000,\r\n            max: 1000000000,\r\n            stepinterval: 50,\r\n            maxboostedstep: 10000000,\r\n            prefix: '$'\r\n        });\r\n\r\n        // vertical buttons with custom icons:\r\n        $('#kt_touchspin_2_validate').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n\r\n            min: 0,\r\n            max: 100,\r\n            step: 0.1,\r\n            decimals: 2,\r\n            boostat: 5,\r\n            maxboostedstep: 10,\r\n        });\r\n\r\n        $('#kt_touchspin_3_validate').TouchSpin({\r\n            buttondown_class: 'btn btn-secondary',\r\n            buttonup_class: 'btn btn-secondary',\r\n            verticalbuttons: true,\r\n            verticalupclass: 'ki ki-plus',\r\n            verticaldownclass: 'ki ki-minus'\r\n        });\r\n    }\r\n\r\n    return {\r\n        // public functions\r\n        init: function() {\r\n            demos();\r\n            validationStateDemos();\r\n        }\r\n    };\r\n}();\r\n\r\njQuery(document).ready(function() {\r\n    KTKBootstrapTouchspin.init();\r\n});\r\n"],"sourceRoot":""}